import React from "react";
import ButtonMain from "../../components/ButtonMain/ButtonMain";
import { buttonBlue, buttonRed, buttonYellow } from "../../utils/colorClasses";

export default function Main() {
  let letterButtons = [];
  let buttonClasses = [buttonYellow, buttonRed, buttonGreen, buttonPurple, buttonChartreuse, buttonCyan, buttonMagenta, buttonBlue, buttonOrang, ]
  for (let letter of "ABCDEFGHIJKLMNOPQRSTUVWXYZ") {
    letterButtons.push(
      <>
        <ButtonMain buttonClass={buttonYellow}>Letter {letter}</ButtonMain>
      </>
    );
  }
  return <>{letterButtons}</>;
}
